import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <div>
      <NavLink exact activeClassName='active_class' to='/'>
        {' '}
        About Us{' '}
      </NavLink>
      <NavLink exact activeClassName='active_class' to='/contact'>
        {' '}
        Contact Us
      </NavLink>
    </div>
  );
};

export default Navbar;
